capture:
{vars {level 1}} {
	set arrays [set scalars [list]]

	foreach var [uplevel $level {info vars}] {
		if {$vars eq "-all" || [lsearch -exact $vars $var] != -1} {
			if [uplevel $level [list array exists $var]] {
			  lappend arrays $var [uplevel $level [list array get $var]]
