glob_to_regexp:
{glob {nocase 0}} {
  set regexp ""
  set escaping 0
  set chars 0
  foreach char [split $glob {}] {
    if $escaping {
      if {$char eq "*" || $char eq "?" || $char eq "\\"} {
        incr chars
        append regexp \\$char
      }
      set escaping 0
    } else {
      if {$char eq "*"} {
        append regexp .*
      } elseif {$char eq "?"} {
        append regexp .
      } else {
        if {$char eq "\\"} {
          set escaping 1
        } else {
          incr chars
          append regexp [escape_regexp $char]
        }
      }
    }
  }
  return [expr {$nocase && $chars ? "(?i)" : ""}]^${regexp}$
}

